import React from 'react';
import { inject, observer } from 'mobx-react';
import { ItemLogsViewStore } from '../stores';
import { ItemLogsTemplate } from '../../../themes/item/pages';

@inject(stores => ({ viewStore: new ItemLogsViewStore(stores.rootStore) }))
@observer
class ItemLogs extends React.Component {
    render() {
        // if (!this.props.viewStore.categories || !this.props.viewStore.item) {
        //     return <div />
        // }
        return (
            <ItemLogsTemplate viewStore={this.props.viewStore} />
        )
    }
}

export default ItemLogs;
